🐚The #Zhuhai Grand Theatre is the only opera house in China built on an island. It looks like two shells, hence named 'Sun and Moon Shell'. #CEAir invites you to have a romantic date together. Wanna come?
#TravelwithCEAir photo cr. Qian Wenpan
@CulturalLingnan @ExploreZhuhai https://t.co/hQK2QuuTgf

🗼Check out this elegant structure with #CEAir! The #CantonTower in #Guangzhou is the tallest tower in China. This multi-function building offers sightseeing, food, shopping, and extreme challenges, all in one! #TravelwithCEAir 
